    @Test
    public void executeTests() {
        // This test only works when the target app is at the head of the
        // faults branch

        File currentDir = new File(System.getProperty("user.dir"));
        File parentDir = currentDir.getParentFile();

        String testHarnessPath = parentDir.getAbsolutePath() + "/historical-fault-localization-target-ruby-app/test_harness/code_coverage.rb";
        String workingDirectory = parentDir.getAbsolutePath() + "/historical-fault-localization-target-ruby-app";
        String commitHash = "asdf";
        String timestamp = "asdf";

        try
        {
            TestExecutionData results = new TestExecutor()
                    .executeTests(testHarnessPath, workingDirectory, commitHash,
                            timestamp, 30000L);
            
            TestExecutionData expectedResults = generateExpectedResults();
            
            // This doesn't guarantee that the results are correct, but it is
            // reasonably fast and will catch many mistakes
            Assert.assertTrue(results.getStatements().equals(expectedResults.getStatements()));
        } catch (IOException err)
        {
            Assert.fail("Should not throw IOException for this test");
        }

    }

